    "Define custom functions for the assistant. Make sure to add a good description for your functions so the assistant knows when to call your function. Each function needs a datapoint that starts the process and another datapoint that contains the result of your function.": {"en": "Define custom functions for the assistant. Make sure to add a good description for your functions so the assistant knows when to call your function. Each function needs a datapoint that starts the process and another datapoint that contains the result of your function.", "de": "Definieren Sie benutzerdefinierte Funktionen für den Assistenten. Fügen Sie eine gute Beschreibung für Ihre Funktionen hinzu, damit der Assistent weiß, wann er Ihre Funktion aufrufen soll. Jede Funktion benötigt einen Datenpunkt, der den Prozess startet, und einen weiteren Datenpunkt, der das Ergebnis Ihrer Funktion enthält.", "ru": "Определите пользовательские функции для помощника. Обязательно добавьте хорошее описание своих функций, чтобы помощник знал, когда вызывать вашу функцию. Каждой функции нужна точка данных, которая запускает процесс, и другая точка данных, содержащая результат вашей функции.", "pt": "Defina funções personalizadas para o assistente. Certifique-se de adicionar uma boa descrição para suas funções para que o assistente saiba quando chamá-la. Cada função precisa de um ponto de dados que inicie o processo e outro ponto de dados que contenha o resultado da sua função.", "nl": "Definieer aangepaste functies voor de assistent. Zorg ervoor dat u een goede omschrijving van uw functies toevoegt, zodat de assistent weet wanneer hij uw functie moet oproepen. Elke functie heeft een datapunt nodig dat het proces start, en een ander datapunt dat het resultaat van uw functie bevat.", "fr": "Définissez des fonctions personnalisées pour l'assistant. Assurez-vous d'ajouter une bonne description de vos fonctions afin que l'assistant sache quand appeler votre fonction. Chaque fonction a besoin d'un point de données qui démarre le processus et d'un autre point de données qui contient le résultat de votre fonction.", "it": "Definire funzioni personalizzate per l'assistente. Assicurati di aggiungere una buona descrizione per le tue funzioni in modo che l'assistente sappia quando chiamare la tua funzione. Ogni funzione necessita di un punto dati che avvii il processo e di un altro punto dati che contenga il risultato della funzione.", "es": "Definir funciones personalizadas para el asistente. Asegúrese de agregar una buena descripción de sus funciones para que el asistente sepa cuándo llamar a su función. Cada función necesita un punto de datos que inicie el proceso y otro punto de datos que contenga el resultado de su función.", "pl": "Zdefiniuj niestandardowe funkcje asystenta. Pamiętaj, aby dodać dobry opis swoich funkcji, aby asystent wiedział, kiedy wywołać Twoją funkcję. Każda funkcja potrzebuje punktu danych rozpoczynającego proces i innego punktu danych zawierającego wynik funkcji.", "uk": "Визначте спеціальні функції для помічника. Обов’язково додайте хороший опис своїх функцій, щоб помічник знав, коли викликати вашу функцію. Для кожної функції потрібна точка даних, яка запускає процес, і інша точка даних, яка містить результат вашої функції.", "zh-cn": "为助手定义自定义功能。确保为您的函数添加良好的描述，以便助手知道何时调用您的函数。每个函数都需要一个启动进程的数据点和另一个包含函数结果的数据点。"},
    "Describe the personality of your assistant": {   "en": "Describe the personality of your assistant",       "de": "Beschreiben Sie die Persönlichkeit Ihres Assistenten", "ru": "Опишите личность вашего помощника",                "pt": "Descreva a personalidade do seu assistente",       "nl": "Beschrijf de persoonlijkheid van uw assistent",    "fr": "Décrivez la personnalité de votre assistant",      "it": "Descrivi la personalità del tuo assistente",       "es": "Describe la personalidad de tu asistente.",        "pl": "Opisz osobowość swojego asystenta",                "uk": "Опишіть характер свого помічника",                 "zh-cn": "描述一下你的助理的性格"},
    "Describe what your function does and how the data for the request should look. This is important for the assistant to understand your function.": {"en": "Describe what your function does and how the data for the request should look. This is important for the assistant to understand your function.", "de": "Beschreiben Sie, was Ihre Funktion macht und wie die Daten für die Anfrage aussehen sollen. Dies ist wichtig, damit der Assistent Ihre Funktion versteht.", "ru": "Опишите, что делает ваша функция и как должны выглядеть данные для запроса. Это важно, чтобы помощник понял ваши функции.", "pt": "Descreva o que sua função faz e como devem ser os dados da solicitação. Isso é importante para que o assistente entenda sua função.", "nl": "Beschrijf wat uw functie doet en hoe de gegevens voor het verzoek eruit moeten zien. Dit is belangrijk voor de assistent om uw functie te begrijpen.", "fr": "Décrivez ce que fait votre fonction et à quoi devraient ressembler les données de la requête. Ceci est important pour que l’assistant comprenne votre fonction.", "it": "Descrivi cosa fa la tua funzione e come dovrebbero apparire i dati per la richiesta. Questo è importante affinché l'assistente comprenda la tua funzione.", "es": "Describe qué hace tu función y cómo deben verse los datos de la solicitud. Esto es importante para que el asistente comprenda su función.", "pl": "Opisz, co robi Twoja funkcja i jak powinny wyglądać dane dla żądania. Jest to ważne, aby asystent rozumiał Twoją funkcję.", "uk": "Опишіть, що робить ваша функція і як мають виглядати дані для запиту. Це важливо, щоб помічник розумів вашу функцію.", "zh-cn": "描述您的函数的作用以及请求的数据应如何显示。这对于助理了解您的职能非常重要。"},
