    "Do you really want to import objects from enum.rooms? Existing objects will be reset!": {"en": "Do you really want to import objects from enum.rooms? Existing objects will be reset!", "de": "Möchten Sie wirklich Objekte aus enum.rooms importieren? Bestehende Objekte werden zurückgesetzt!", "ru": "Вы действительно хотите импортировать объекты из enum.rooms? Существующие объекты будут сброшены!", "pt": "Você realmente deseja importar objetos de enum.rooms? Os objetos existentes serão redefinidos!", "nl": "Wilt u echt objecten uit enum.rooms importeren? Bestaande objecten worden gereset!", "fr": "Voulez-vous vraiment importer des objets depuis enum.rooms ? Les objets existants seront réinitialisés !", "it": "Vuoi davvero importare oggetti da enum.rooms? Gli oggetti esistenti verranno ripristinati!", "es": "¿Realmente quieres importar objetos desde enum.rooms? ¡Los objetos existentes se restablecerán!", "pl": "Czy na pewno chcesz importować obiekty z enum.rooms? Istniejące obiekty zostaną zresetowane!", "uk": "Ви дійсно хочете імпортувати об’єкти з enum.rooms? Існуючі об'єкти будуть скинуті!", "zh-cn": "您真的想从 enum.rooms 导入对象吗？现有对象将被重置！"},
