    "Give your personal assistant a name and describe its personality. Choose a model that should be used for your assistant.": {"en": "Give your personal assistant a name and describe its personality. Choose a model that should be used for your assistant.", "de": "Geben Sie Ihrem persönlichen Assistenten einen Namen und beschreiben Sie seine Persönlichkeit. Wählen Sie ein Modell aus, das für Ihren Assistenten verwendet werden soll.", "ru": "Дайте своему личному помощнику имя и опишите его личность. Выберите модель, которую следует использовать для вашего помощника.", "pt": "Dê um nome ao seu assistente pessoal e descreva sua personalidade. Escolha um modelo que deve ser usado para seu assistente.", "nl": "Geef uw persoonlijke assistent een naam en beschrijf zijn persoonlijkheid. Kies een model dat voor uw assistent moet worden gebruikt.", "fr": "Donnez un nom à votre assistant personnel et décrivez sa personnalité. Choisissez un modèle qui doit être utilisé pour votre assistant.", "it": "Dai un nome al tuo assistente personale e descrivi la sua personalità. Scegli un modello che dovrebbe essere utilizzato per il tuo assistente.", "es": "Dale un nombre a tu asistente personal y describe su personalidad. Elija un modelo que deba usarse para su asistente.", "pl": "Nadaj swojemu osobistemu asystentowi imię i opisz jego osobowość. Wybierz model, który ma być zastosowany dla Twojego asystenta.", "uk": "Назвіть свого персонального помічника та опишіть його характер. Виберіть модель, яка буде використовуватися для вашого помічника.", "zh-cn": "为您的私人助理命名并描述其个性。选择适合您的助手的型号。"},
    "How long to wait between retries": {             "en": "How long to wait between retries",                 "de": "Wie lange zwischen Wiederholungen gewartet werden soll", "ru": "Как долго ждать между повторными попытками",       "pt": "Quanto tempo esperar entre novas tentativas",      "nl": "Hoe lang er moet worden gewacht tussen nieuwe pogingen", "fr": "Combien de temps attendre entre les tentatives",   "it": "Quanto tempo attendere tra un nuovo tentativo e l'altro", "es": "¿Cuánto tiempo esperar entre reintentos?",         "pl": "Jak długo należy czekać między ponownymi próbami", "uk": "Як довго чекати між повторними спробами",          "zh-cn": "重试之间等待多长时间"},
    "How many times should we retry if request to model fails": {"en": "How many times should we retry if request to model fails", "de": "Wie oft soll bei fehlgeschlagener Modellanfrage wiederholt werden", "ru": "Сколько раз мы должны повторить попытку, если запрос на моделирование не удался", "pt": "Quantas vezes devemos tentar novamente se a solicitação do modelo falhar", "nl": "Hoe vaak moeten we het opnieuw proberen als het verzoek om te modelleren mislukt", "fr": "Combien de fois devons-nous réessayer si la demande de modélisation échoue", "it": "Quante volte dovremmo riprovare se la richiesta al modello fallisce", "es": "¿Cuántas veces debemos volver a intentarlo si falla la solicitud de modelo?", "pl": "Ile razy powinniśmy ponawiać próbę, jeśli żądanie modelu nie powiedzie się", "uk": "Скільки разів ми маємо повторити спробу, якщо запит до моделі не вдається", "zh-cn": "如果模型请求失败，我们应该重试多少次"},
    "If greater 0 previous messages will be included in the request so the tool will stay in context": {"en": "If greater 0 previous messages will be included in the request so the tool will stay in context", "de": "Bei Werten größer 0 werden vorherige Nachrichten in die Anfrage einbezogen, damit das Tool im Kontext bleibt", "ru": "Если в запрос будет включено больше 0 предыдущих сообщений, инструмент останется в контексте.", "pt": "Se for maior que 0, as mensagens anteriores serão incluídas na solicitação para que a ferramenta permaneça no contexto", "nl": "Als er meer 0 zijn, worden eerdere berichten in het verzoek opgenomen, zodat de tool in context blijft", "fr": "Si supérieur à 0, les messages précédents seront inclus dans la requête afin que l'outil reste en contexte", "it": "Se maggiore di 0 i messaggi precedenti verranno inclusi nella richiesta, lo strumento rimarrà nel contesto", "es": "Si es mayor, se incluirán 0 mensajes anteriores en la solicitud para que la herramienta permanezca en contexto", "pl": "Jeśli więcej niż 0, poprzednie wiadomości zostaną uwzględnione w żądaniu, więc narzędzie pozostanie w kontekście", "uk": "Якщо більше 0, попередні повідомлення будуть включені в запит, тому інструмент залишатиметься в контексті", "zh-cn": "如果请求中将包含大于 0 的先前消息，则该工具将保留在上下文中"},
